sys_variable_value.value:
(function() {
	// return the value to use for Parameter 1
	var addressees = current.request.requested_for.email+ "";
	var ssmEmail= current.variables.email_address+"";
	if(ssmEmail != "undefined"){
		addressees = ssmEmail;
	}
	var name = current.request.requested_for.name+ "";
	var ssmName= current.variables.EmployeeName+"";
	if(ssmName != "undefined"){
		name = ssmName;
	}
	
	
	gs.eventQueue('x_dehp_health_well.sc_req_item.workout_n', current, addressees, name);
}());

